function updateGraphEditorData(element, data) {
  console.log("Initializing Graph Example...");
  if (element.firstChild){
    element.firstChild.remove();
  }

  var jsongraph = document.createElement('ecore-graph');
  jsongraph.data = data;

  element.appendChild(jsongraph);
}
